<p>But Node.js is asynchronous so this code would not work properly.
I've read that I can use Promise to get the code to run in a certain order.</p>

<p>I read the documentation about the Promise and some sites that showed simple tutorials.
The structure of a Promise is:</p>

<pre><code>// some code (A)

var promise = new Promise(function(resolve, reject) {
    // some code (B)
});

promise.then(function() {
    // some code (C)
});

promise.catch(function() {
    // some code (D)
});

// some code (E)
</code></pre>

